import { useDispatch } from "react-redux";
import { loadPath } from "../store";

const dispatch = useDispatch();
function useNavigate(path)
{
    console.log("navigating to ", path);
    window.history.pushState({}, '', path);

    dispatch(loadPath(path));
}

export {useNavigate};
